import React from 'react'
import Card from '../../UI/Card';

const KeyConcept = (props) => {
  return (
    <Card>

    <li className="concept">
      <img src={props.image} alt={props.title} />
      <h2>{props.title}</h2>
      <p>{props.description}</p>
    </li>

    </Card>
  )
}

export default KeyConcept
